import React, { Component } from 'react'

export class Experiences extends Component {
  render() {
    return (
      <div>
        <div className="Experiences">
            <div className="section-head">
                <h1>EXPERIENCES</h1>
                <p>SCHOOL, WORK, TRAVEL</p>
                <div></div>
            </div>
        </div>
      </div>
    )
  }
}

export default Experiences
